description:
Belfast to Monte Carlo

Travel Documentary hosted by Jason Barlow, published by BBC in 2004 - English narration


Information
------------------------------

It's been 50 years since local motoring legend Paddy Hopkirk and his co-driver Henry Liddon won one of the biggest events in the sporting calendar, the Monte Carlo Rally. Paddy and former Top Gear presenter Jason Barlow retrace the original route at the wheel of a modern Mini Cooper. The film blends contemporary footage of their eight day journey with nostalgic archive clips, harking back to the heady days when the Mini was a cultural icon, owned by the rich and stylish.

